import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <div className="App">
      <ul>
        <li>First</li>
        <li>Second</li>
        <li>Third</li>
        <li>Fourth</li>
      </ul>
    </div>
  );

}

export default App;
